void top::thread_ap_NS_fsm() {
    switch (ap_CS_fsm.read().to_uint64()) {
        case 1 : 
            if ((esl_seteq<1,1,1>(ap_const_logic_1, ap_CS_fsm_state1.read()) && esl_seteq<1,1,1>(ap_start.read(), ap_const_logic_1))) {
                ap_NS_fsm = ap_ST_fsm_state2;
            } else {
                ap_NS_fsm = ap_ST_fsm_state1;
            }
            break;
        case 2 : 
            if ((esl_seteq<1,1,1>(ap_const_logic_1, ap_CS_fsm_state2.read()) && esl_seteq<1,1,1>(grp_load_and_rearrange_q_fu_92_ap_done.read(), ap_const_logic_1))) {
                ap_NS_fsm = ap_ST_fsm_state3;
            } else {
                ap_NS_fsm = ap_ST_fsm_state2;
            }
            break;
        case 4 : 
            ap_NS_fsm = ap_ST_fsm_state4;
            break;
        case 8 : 
            if ((esl_seteq<1,1,1>(ap_const_logic_1, ap_CS_fsm_state4.read()) && esl_seteq<1,1,1>(grp_compute_attention_fu_56_ap_done.read(), ap_const_logic_1))) {
                ap_NS_fsm = ap_ST_fsm_state5;
            } else {
                ap_NS_fsm = ap_ST_fsm_state4;
            }
            break;
        case 16 : 
            ap_NS_fsm = ap_ST_fsm_state6;
            break;
        case 32 : 
            if ((esl_seteq<1,1,1>(ap_const_logic_1, ap_CS_fsm_state6.read()) && esl_seteq<1,1,1>(grp_store_output_fu_122_ap_done.read(), ap_const_logic_1))) {
                ap_NS_fsm = ap_ST_fsm_state1;
            } else {
                ap_NS_fsm = ap_ST_fsm_state6;
            }
            break;
        default : 
            ap_NS_fsm =  (sc_lv<6>) ("XXXXXX");
            break;
    }
}

void top::thread_hdltv_gen() {
    const char* dump_tv = std::getenv("AP_WRITE_TV");
    if (!(dump_tv && string(dump_tv) == "on")) return;

    wait();

    mHdltvinHandle << "[ " << endl;
    mHdltvoutHandle << "[ " << endl;
    int ap_cycleNo = 0;
    while (1) {
        wait();
        const char* mComma = ap_cycleNo == 0 ? " " : ", " ;
        mHdltvinHandle << mComma << "{"  <<  " \"ap_rst\" :  \"" << ap_rst.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"ap_start\" :  \"" << ap_start.read() << "\" ";
        mHdltvoutHandle << mComma << "{"  <<  " \"ap_done\" :  \"" << ap_done.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ap_idle\" :  \"" << ap_idle.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"ap_ready\" :  \"" << ap_ready.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"input_data_address0\" :  \"" << input_data_address0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"input_data_ce0\" :  \"" << input_data_ce0.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"input_data_q0\" :  \"" << input_data_q0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"input_data_address1\" :  \"" << input_data_address1.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"input_data_ce1\" :  \"" << input_data_ce1.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"input_data_q1\" :  \"" << input_data_q1.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"output_data_address0\" :  \"" << output_data_address0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"output_data_ce0\" :  \"" << output_data_ce0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"output_data_we0\" :  \"" << output_data_we0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"output_data_d0\" :  \"" << output_data_d0.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"output_data_address1\" :  \"" << output_data_address1.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"output_data_ce1\" :  \"" << output_data_ce1.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"output_data_we1\" :  \"" << output_data_we1.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"output_data_d1\" :  \"" << output_data_d1.read() << "\" ";
        mHdltvinHandle << "}" << std::endl;
        mHdltvoutHandle << "}" << std::endl;
        ap_cycleNo++;
    }
}

